import React, { useState } from 'react'

function Sidebar() {
  const [inputValue, setInputValue] = useState('');

  return (
    <div>
      <div>Log in</div>
      <div>
        <input value={inputValue} onChange={e => setInputValue(e.target.value)} />
      </div>
      <div> Chats...</div>
    </div>
  )
}

export default Sidebar
